import React from 'react';
import './Leadership.css';

function Leadership() {
  const leaders = [
    {
      name: 'Ihuoma Emelogu',
      position: 'President',
      image: 'https://via.placeholder.com/300x300/7f1d1d/ffffff?text=IE',
      bio: 'Leading with vision and dedication to community service'
    },
    {
      name: 'Igwe Ihekoronye',
      position: 'Secretary',
      image: 'https://via.placeholder.com/300x300/991b1b/ffffff?text=II',
      bio: 'Ensuring smooth operations and transparent communication'
    },
    {
      name: 'Amii International',
      position: 'Treasurer',
      image: 'https://via.placeholder.com/300x300/b91c1c/ffffff?text=MN',
      bio: 'Managing financial resources with integrity'
    },
    {
      name: 'Member Name',
      position: 'Vice President',
      image: 'https://via.placeholder.com/300x300/dc2626/ffffff?text=VP',
      bio: 'Supporting leadership and community initiatives'
    },
    {
      name: 'Member Name',
      position: 'Public Relations Officer',
      image: 'https://via.placeholder.com/300x300/ef4444/ffffff?text=PR',
      bio: 'Building community relationships and outreach'
    },
    {
      name: 'Member Name',
      position: 'Financial Secretary',
      image: 'https://via.placeholder.com/300x300/f87171/ffffff?text=FS',
      bio: 'Recording and documenting financial transactions'
    }
  ];

  return (
    <div className="leadership">
      <div className="leadership-hero">
        <h1>Our Leadership</h1>
        <p>Meet the dedicated team leading August 93 Club - Ohanze Congress</p>
      </div>

      <div className="container">
        <div className="leaders-grid">
          {leaders.map((leader, index) => (
            <div key={index} className="leader-card">
              <div className="leader-image">
                <img src={leader.image} alt={leader.name} />
              </div>
              <div className="leader-info">
                <h3>{leader.name}</h3>
                <p className="position">{leader.position}</p>
                <p className="bio">{leader.bio}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Leadership;
